@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document domain("scenehd.org") {

body{background-color:#000000!important;color:#CCCCCC!important;}
body>table[width="100%"] {color:#CCCCCC!important;background-color:#000000!important;}
body>table[width="100%"]>tbody>tr>td+td>a>img{
background: url("data:image/png;base64,") transparent !important;
width: 0px !important;
height: 110px !important;
padding-left: 436px !important;
}

table.main,table.mainouter{background-color:#2A2A2A!important;color:#CCCCCC!important;}
table{background-color:#474747!important;color:#CCCCCC!important;}

td {border:1px solid #000000!important;}
td.outer>table.bottom{background-color:#2A2A2A!important;}
td.embedded,td.bottom {border:none!important;}
td.colhead {background-color:#474747!important;background-image:url("data:image/gif;base64,")!important;}
td.clear {border:0px none!important;}
tr[style="background: rgb(233, 247, 205) none repeat scroll 0%; -moz-background-clip: -moz-initial; -moz-background-origin: -moz-initial; -moz-background-inline-policy: -moz-initial;"],tr[style="background: rgb(233, 247, 205) none repeat scroll 0% 0%; -moz-background-clip: -moz-initial; -moz-background-origin: -moz-initial; -moz-background-inline-policy: -moz-initial;"]{background:#363636 none repeat scroll 0%!important;}
td[style="border: 1px dotted black; background-color: rgb(233, 247, 205);"] {background-color:#161616!important;}
td[style="background-color: rgb(147, 197, 76);"] {background-color:#000000!important;}
td[bgcolor="white"],tr[bgcolor="#ffffff"]{background-color:#2A2A2A!important;}
td[bgcolor="#ffd9d9"]{background-color:#800000!important;}
td[bgcolor="#d9e8ff"]{background-color:#000080!important;}
td[bgcolor="#e9f7cd"]{background-color:#C49123!important;}
td[bgcolor="#ece9d8"]{background-color:#2A2A2A!important;}
td[bgcolor="#f4f4f0"]{background-color:#474747!important;}
td[bgcolor="#bbaf9b"]{background-color:#363636!important;}
tr[bgcolor="#7ccd7c"],tr[style="background-color: rgb(147, 197, 76);"]
{background-color:#004000!important;}
tr[bgcolor="#ee6a50"]{background-color:#800000!important;}
tr[bgcolor="#e3ffba"],td[bgcolor="#e3ffba"]{background-color:#363636!important;}
tr[style="background-color: rgb(255, 255, 255);"]{background-color:#2A2A2A!important;}
tr[style="background-color: rgb(217, 232, 255);"],tr[style="background-color: #E9F7CD;"]{background-color:#000080!important;}
fieldset[style="width: 535px; text-align: left; background-color: rgb(247, 247, 247);"]{background-color:#474747!important;}
legend{color:#CCCCCC !important}
fieldset table {background:#474747 none repeat scroll 0%!important;}

a:link,a:visited {color:#AAAAAA!important;text-decoration:none!important;}
a:hover {color:#EEEEEE!important;text-decoration:underline!important;}

#tabnav a.active:link, #tabnav a.active:visited {
background:#474747 none repeat scroll 0%!important;
border-color:#000000 #000000 #474747!important;}
#tabnav1 a.active:link, #tabnav1 a.active:visited {
background:#474747 none repeat scroll 0%!important;
border-color:#474747 #000000 #000000 !important;}
#tabnav a:link, #tabnav a:visited,#tabnav1 a:link, #tabnav1 a:visited {
background:#363636 none repeat scroll 0%!important;
border-color:#000000!important;}
#tabnav1 li a[style="background: red none repeat scroll 0%; -moz-background-clip: -moz-initial; -moz-background-origin: -moz-initial; -moz-background-inline-policy: -moz-initial;"],#tabnav1 li a[style="background: red none repeat scroll 0% 0%; -moz-background-clip: -moz-initial; -moz-background-origin: -moz-initial; -moz-background-inline-policy: -moz-initial;"]
{background:#800000 none repeat scroll 0%!important;}

input, select, textarea {background:#333333 !important;border:1px solid #A0A0A0 !important;color:#333333 !important;}
.btn{height:18px!important;margin-left:5px!important;}

font[color="#1900d1"]{color:#000080!important;}
font[color="#000000"],font[color="black"]{color:black!important;}
font[color="green"]{color:green!important;}
font[color="darkred"]{color:#800000!important;}
font[color="red"]{color:#800000!important;}

img[src="/pic/forumikoner/standard.gif"]{
background: url("data:image/gif;base64,") transparent !important;
width: 0px !important;
height: 29px !important;
padding-left: 29px !important;
}
